Bien sûr ! Voici un code HTML/CSS simple pour un site de la Saint-Valentin avec un cœur qui bat et un message romantique.

Ce code crée un cœur rouge qui pulse doucement, et un message centré sur la page.

```html
<!DOCTYPE html>
<html lang="fr">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Joyeuse Saint-Valentin !</title>
    <style>
        body {
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            min-height: 100vh;
            background-color: #f7e6e6; /* Fond rose très clair */
            margin: 0;
            font-family: 'Arial', sans-serif;
            color: #d62839; /* Couleur du texte assortie au cœur */
            text-align: center;
        }

        .heart-container {
            position: relative;
            width: 100px;
            height: 90px;
            margin-bottom: 30px;
            animation: beat 1.5s infinite; /* Animation de battement */
        }

        .heart-container::before,
        .heart-container::after {
            content: '';
            position: absolute;
            width: 100px;
            height: 100px;
            background-color: #d62839; /* Rouge du cœur */
            border-radius: 50%;
        }

        .heart-container::before {
            left: 50px;
            transform: rotate(-45deg);
            transform-origin: 0 100%;
        }

        .heart-container::after {
            top: -50px;
            left: 0;
            transform: rotate(45deg);
            transform-origin: 100% 100%;
        }

        .message {
            font-size: 2.2em;
            font-weight: bold;
            text-shadow: 2px 2px 4px rgba(0, 0, 0, 0.1);
        }

        /* Animation du cœur */
        @keyframes beat {
            0% { transform: scale(1); }
            15% { transform: scale(1.1); }
            30% { transform: scale(1); }
            45% { transform: scale(1.1); }
            60% { transform: scale(1); }
            100% { transform: scale(1); }
        }
    </style>
</head>
<body>
    <div class="heart-container"></div>
    <div class="message">
        Mon amour, chaque battement de mon cœur est pour toi. <br> Joyeuse Saint-Valentin !
    </div>
</body>
</html>
```

**Comment ça marche :**

1.  **HTML Structure** :
    *   Un `div` avec la classe `heart-container` pour contenir le cœur.
    *   Un `div` avec la classe `message` pour ton texte romantique.

2.  **CSS pour le Cœur** :
    *   Le cœur est créé en utilisant deux pseudo-éléments (`::before` et `::after`) d'un conteneur.
    *   Chaque pseudo-élément est un carré avec un `border-radius: 50%` pour le rendre circulaire.
    *   Ils sont ensuite positionnés et pivotés (`transform: rotate`) pour former la forme classique du cœur.
    *   Le `heart-container` lui-même sert de base pour l'animation.

3.  **Animation de Battement (`@keyframes beat`)** :
    *   L'animation `beat` fait varier la taille (`transform: scale`) du cœur de 100% à 110% à différents moments, simulant un battement de cœur.
    *   `animation: beat 1.5s infinite;` applique cette animation au `heart-container` pour qu'elle se répète toutes les 1.5 secondes à l'infini.

4.  **Message et Style Général** :
    *   Le `body` est stylisé avec `flexbox` pour centrer le contenu verticalement et horizontalement.
    *   Un fond rose clair (`background-color`) et une couleur de texte rouge foncée (`color`) sont choisis pour une ambiance romantique.
    *   Le message est en gras et a une taille de police plus grande.

Copiez-collez ce code dans un fichier `.html` (par exemple, `valentine.html`) et ouvrez-le avec votre navigateur web pour voir le résultat !

